import React from "react";
import { BottomNavigation, BottomNavigationAction, List, ListItem } from "@material-ui/core";

import './footer.css';

const Footer = () => {
    const [value, setValue] = React.useState('recents');

    const handleChange = (event, newEvent) => {
        setValue(newValue);
    }
    return (

        <>
            <BottomNavigation xs={{ width: 500 }} value={value} onChange={handleChange}>
                <BottomNavigationAction
                    lab
                />
            </BottomNavigation>

        </>
    )
}

export default Footer;
